INSERT INTO `composer_quote` VALUES (155712,'It is cruel, you know, that music should be so beautiful. It has the beauty of loneliness of pain: of strength and freedom. The beauty of disappointment and never-satisfied love. The cruel beauty of nature and everlasting beauty of monotony.',36),(155713,'Composing is like driving down a foggy road toward a house. Slowly you see more details of the house-the color of the slates and bricks, the shape of the windows. The notes are the bricks and the mortar of the house.',36),(155714,'These two are not two Love has made them one Amo Ergo Sum! And by its mystery Each is no less but more.',36),(155715,'The old idea of a composer suddenly having a terrific idea and sitting up all night to write it is nonsense. Nighttime is for sleeping.',36),(362523,'Religion is a means of exploitation employed by the strong against the weak; religion is a cloak of ambition, injustice and vice.',29),(362545,'As a musician I tell you that if you were to suppress adultery, fanaticism, crime, evil, the supernatural, there would no longer be the means for writing one note.',29),(362555,'What a beautiful art, but what a wretched profession.',29),(362573,'I want to do nothing chic, I want to have ideas before beginning a piece.',29),(364708,'I pay no attention whatever to anybody\'s praise or blame. I simply follow my own feelings.',158),(364725,'Neither a lofty degree of intelligence nor imagination nor both together go to the making of genius. Love, love, love, that is the soul of genius.',158),(364747,'I thank my God for graciously granting me the opportunity of learning that death is the key which unlocks the door to our true happiness.',158),(364754,'Nevertheless the passions, whether violent or not, should never be so expressed as to reach the point of causing disgust; and music, even in situations of the greatest horror, should never be painful to the ear but should flatter and charm it, and thereby always remain music.',158),(364773,'I cannot write poetically, for I am no poet. I cannot make fine artistic phrases that cast light and shadow, for I am no painter. I can neither by signs nor by pantomime express my thoughts and feelings, for I am no dancer; but I can by tones, for I am a musician.',158),(364790,'One must not make oneself cheap here - that is a cardinal point - or else one is done. Whoever is most impertinent has the best chance.',158),(364808,'It is a great consolation for me to remember that the Lord, to whom I had drawn near in humble and child-like faith, has suffered and died for me, and that He will look on me in love and compassion.',158),(364829,'I am one of those who will go on doing till all doings are at an end.',158),(364844,'We live in this world in order always to learn industriously and to enlighten each other by means of discussion and to strive vigorously to promote the progress of science and the fine arts.',158),(364860,'If I were obliged to marry all those with whom I have jested, I should have at least two hundred wives.',158),(364873,'Just as people behave to me, so do I behave to them. When I see that a person despises me and treats me with contempt, I can be as proud as any peacock.',158),(364882,'When I am traveling in a carriage, or walking after a good meal, or during the night when I cannot sleep; it is on such occasions that ideas flow best and most abundantly.',158),(364895,'Believe me, I do not like idleness but work.',158),(364913,'An unmarried man, in my opinion, enjoys only half a life.',158),(364930,'How sad it is that these great gentlemen should believe what anyone tells them and do not choose to judge for themselves! But it is always so.',158),(364941,'As for pupils, I can have as many as I choose, but I do not choose to take many. I intend to be better paid than others, and so I wish to have fewer scholars. It is advisable to hang back a little at first, or it is all over with you, and you must pursue the common highway with the rest.',158),(364952,'I hope never to marry in this way; I wish to make my wife happy, but not to become rich by her means, so I will let things alone and enjoy my golden freedom till I am so well off that I can support both wife and children.',158),(364967,'Versification is, indeed, indispensable for music, but rhyme, solely for rhyming\'s sake, most pernicious.',158),(364973,'When I come to reflect on the subject, in no country have I received such honors or been so esteemed as in Italy, and nothing contributes more to a man\'s fame than to have written Italian operas, and especially for Naples.',158),(364977,'I know nothing new except that Herr Gellert, the Leipzig poet, is dead, and has written no more poetry since his death.',158),(364987,'My father is maestro at the Metropolitan church, which gives me an opportunity to write for the church as much as I please.',158),(364995,'The happy medium - truth in all things - is no longer either known or valued; to gain applause, one must write things so inane that they might be played on barrel-organs, or so unintelligible that no rational being can comprehend them, though on that very account, they are likely to please.',158),(364999,'I live in a country where music has very little success, though, exclusive of those who have forsaken us, we have still admirable professors and, more particularly, composers of great solidity, knowledge, and taste.',158),(365005,'My sole recreations consist in dancing English hornpipes and cutting capers. Italy is a land of sleep; I am always drowsy here.',158),(365011,'My Constanze is the virtuous, honourable, discreet, and faithful darling of her honest and kindly-disposed Mozart.',158),(462885,'Art is a kind of illness.',190),(462895,'Inspiration is an awakening, a quickening of all man\'s faculties, and it is manifested in all high artistic achievements.',190),(506463,'Wagner has lovely moments but awful quarters of an hour.',206),(506476,'One can\'t judge Wagner\'s opera Lohengrin after a first hearing, and I certainly don\'t intend to hear it a second time.',206),(506489,'Give me a laundry-list and I\'ll set it to music.',206),(506502,'Every kind of music is good, except the boring kind.',206),(506513,'Mr. Wagner has beautiful moments but bad quarters of an hour.',206),(506525,'Wagner is a composer who has beautiful moments but awful quarter hours.',206),(514919,'You may have the universe if I may have Italy.',246),(514934,'I adore art... when I am alone with my notes, my heart pounds and the tears stream from my eyes, and my emotion and my joys are too much to bear.',246),(539261,'The human voice is the most beautiful instrument of all, but it is the most difficult to play.',229),(539275,'Never look encouragingly at the brass, except with a short glance to give an important cue.',229),(539279,'I may not be a first-rate composer, but I am a first-class second-rate composer.',229),(539289,'Bear in mind that you are not making music for your own pleasure, but for the pleasure of your audience.',229),(539301,'Never let the horns and woodwinds out of your sight; if you can hear them at all, they are too loud.',229),(539312,'Never look at the trombones. You\'ll only encourage them.',229),(540083,'Joy is not in things; it is in us.',250),(540084,'Imagination creates reality.',250),(540085,'I hate this fast growing tendency to chain men to machines in big factories and deprive them of all joy in their efforts - the plan will lead to cheap men and cheap products.',250),(540086,'I am convinced that there are universal currents of Divine Thought vibrating the ether everywhere and that any who can feel these vibrations is inspired.',250),(540087,'I wish I could score everything for horns.',250),(540088,'I write music with an exclamation point!',250),(540089,'Wherever the fish are, that\'s where we go.',250),(540090,'Achievements, seldom credited to their source, are the result of unspeakable drudgery and worries.',250),(540091,'Divorce is one of the most financially traumatic things you can go through. Money spent on getting mad or getting even is money wasted.',250),(540092,'I am fond of them, of the inferior beings of the abyss, of those who are full of longing.',250),(540093,'Richard Wagner, a musician who wrote music which is better than it sounds.',250),(540094,'Though German art can never be Bavarian, but simply German, yet Munich is the capital of this German Art; here, under shelter of a Prince who kindles my enthusiasm, to feel myself a native and member of the people was, to me, the homeless wanderer, a deep, a genuine need.',250),(540095,'Everything lives and lasts by the inner necessity of its being, by its own nature\'s need.',250),(540096,'I can\'t distract myself enough here, for sketches to a new opera are constantly buzzing around in my head, to the extent that I need all my strength to wrest myself from them.',250),(540097,'I was in a state of gnawing, sensuous agitation that excited continually both blood and nerves when I sketched out the music for \'Tannhauser\' and brought it to completion.',250),(540098,'The patriot subordinates himself to his State in order to raise it above all other States and thus, as it were, to find his personal sacrifice repaid with ample interest through the might and greatness of his fatherland.',250),(540099,'What manner of thing this \'public opinion\' is, should be best known to those who have its name forever in their mouths and erect the regard for it into a positive article of religion. Its self-styled organ in our times is the \'Press.\'',250),(540100,'Here, everything is tragic through and through, and the will, that fain would shape a world according to its wish, at last can reach no greater satisfaction than the breaking of itself in dignified annulment.',250),(540101,'Even if I know I shall never change the masses, never transform anything permanent, all I ask is that the good things also have their place, their refuge.',250),(540102,'Life is earnest - and always has been.',250),(540103,'I have only a mind to live, to enjoy - i.e., to work as an artist, and produce my works; but not for the muddy brains of the common herd.',250),(540104,'In no State is there a weightier law than that which centers its stability in the supreme hereditary power of one particular family, unconnected and un-commingling with any other lineage in that State.',250),(540105,'I have long been convinced that my artistic ideal stands or falls with Germany. Only the Germany that we love and desire can help us achieve that ideal.',250),(540106,'How absurd these critics must seem to me, who in their modern wantonness have become so ingenious. They want to interpret my Tannhauser as specifically Christian and impute to him a tendency to impotent glorification!',250),(540107,'We find personal success and great, if not enduring, influence on the outer fashioning of the world allotted to the violent, the passionate individual who, unchaining the elemental principles of human impulse under favoring circumstances, points out to greed and self-indulgence the speedy pathways to their satisfaction.',250),(659876,'Music should strike fire from the heart of man, and bring tears from the eyes of woman.',20),(659886,'Music is a higher revelation than all wisdom and philosophy.',20),(659900,'Only the pure in heart can make a good soup.',20),(659909,'Don\'t only practice your art, but force your way into its secrets; art deserves that, for it and knowledge can raise man to the Divine.',20),(659928,'What you are, you are by accident of birth; what I am, I am by myself. There are and will be a thousand princes; there is only one Beethoven.',20),(659940,'Music is the mediator between the spiritual and the sensual life.',20),(659948,'I will seize fate by the throat; it shall certainly never wholly overcome me.',20),(659957,'Nothing is more intolerable than to have to admit to yourself your own errors.',20),(659967,'The true artist is not proud: he unfortunately sees that art has no limits; he feels darkly how far he is from the goal, and though he may be admired by others, he is sad not to have reached that point to which his better genius only appears as a distant, guiding sun.',20),(659976,'Music is the one incorporeal entrance into the higher world of knowledge which comprehends mankind but which mankind cannot comprehend.',20),(659985,'This is the mark of a really admirable man: steadfastness in the face of trouble.',20),(659993,'Recommend virtue to your children; it alone, not money, can make them happy. I speak from experience.',20),(660004,'O, you men who think or say that I am malevolent, stubborn or misanthropic, how greatly do you wrong me. You do not know the secret cause which makes me seem that way to you, and I would have ended my life - it was only my art that held me back. Ah, it seemed impossible to leave the world until I had brought forth all that I felt was within me.',20),(660013,'Music is the wine which inspires one to new generative processes, and I am Bacchus who presses out this glorious wine for mankind and makes them spiritually drunken.',20),(660020,'Tones sound, and roar and storm about me until I have set them down in notes.',20),(660030,'Music comes to me more readily than words.',20),(660037,'I joyfully hasten to meet death. If it come before I have had opportunity to develop all my artistic faculties, it will come, my hard fate notwithstanding, too soon, and I should probably wish it later - yet even then I shall be happy, for will it not deliver me from a state of endless suffering?',20),(660044,'The barriers are not erected which can say to aspiring talents and industry, \'Thus far and no farther.\'',20),(660055,'Beethoven can write music, thank God, but he can do nothing else on earth.',20),(660065,'Art! Who comprehends her? With whom can one consult concerning this great goddess?',20),(660075,'Friends applaud, the comedy is over.',20),(660087,'Off with you! You\'re a happy fellow, for you\'ll give happiness and joy to many other people. There is nothing better or greater than that!',20),(660094,'A great poet is the most precious jewel of a nation.',20),(660105,'I must confess that I lead a miserable life. For almost two years, I have ceased to attend any social functions, just because I find it impossible to say to people, \'I am deaf.\' If I had any other profession, I might be able to cope with my infirmity; but in my profession, it is a terrible handicap.',20),(660111,'There ought to be an artistic depot where the artist need only hand in his artwork in order to receive what he asks for. As things are, one must be half a business man, and how can one understand - good heavens! - that\'s what I really call troublesome.',20),(727424,'The end of all good music is to affect the soul.',157),(727430,'Music is spiritual. The music business is not.',157),(727437,'The modern composer builds upon the foundation of truth.',157);
/*!40000 ALTER TABLE `composer_quote` ENABLE KEYS */;
UNLOCK TABLES;

